import React from 'react';
import { Modal,CardColumns,CardGroup,Card,Button,View,Table,Container,Nav,Navbar,NavDropdown,Row,Col } from 'react-bootstrap';

import 'bootstrap/dist/css/bootstrap.min.css';
import './LeaderBoard.css';



const User = (props) => {

  return(
    <tr key={props.index}>
      <td >{props.data[0]}</td>
      <td >{props.data[1]}</td>
      <td >{props.data[2]}</td>
      <td >{props.data[3]}</td>
      <td >{Math.round((100*(props.data[3]*props.allGame1_total_game_tries/props.game1_prize))*0.8)} Blox</td>
      <td>{props.game1_prize}</td>
    </tr>


  )
}






export default User;
